import React, { Component } from 'react'

class TickerList extends Component {
    constructor(props) {
        super(props)

        this.state = {
            activeTicker: false
        }
    }

    render() {

        const tickerList = [
            {
            'companyName': 'Amazon',
            'ticker':'AMZN',
            'price': '$666',
            active: false
            }, 
            {
            'companyName':'Facebook',
            'ticker':'FB',
            'price': '$420',
            active: false
            },
            {
            'companyName': 'Tesla',
            'ticker':'TSLA',
            'price': '$69',
            active: false
            }
        ]

        const tickerMap = tickerList.map((item) => 
        <li key={item.ticker}> {item.ticker} {item.price} </li> 
        )
        return (
            <div className="ticker-app-container">
                {tickerMap}
            </div>
        )
    }
}

export default TickerList
